import React from 'react';
import logo from './logo.svg';
import './App.css';

function nama(element) {

if (element.nama == "ia") {
  return element.nama + " " + element.kk;
}
  return "maaf slah";
}

const element = {
  nama: 'deni',
  kk:'denot'
}

const spec = "gg";

const tampil=nama(element);
const dandi = <div> tes  {spec}</div>;

function Welcome(props) {
  return <h1>Hello, {props.name}</h1>;
}

function Comment (props) { 
  return (
    <div>
    <img
      className="Avatar"
      src={props.author.avatarUrl}
      alt={props.author.name}
    />
      <p>{props.text}</p>
      <p>{props.author.name}</p>
      <p>{new Date().toLocaleDateString()}</p>
    </div>
  )
 }

 function Sum() { 
   return 1+2;
  }

 function Clock(props) {
   return (
     <div>
       <h1>Hello, world!</h1>
       <h2>It is {props.date.toLocaleTimeString()}.</h2>
     </div>
   )

 }

const comment = {
          date: new Date(),
          text: 'I hope you enjoy learning React!',
          author: {
            name: 'Dandi',
            avatarUrl: 'https://asset-a.grid.id/crop/0x0:0x0/700x0/photo/2018/10/19/2605653088.jpg',
          },
        };



function FormattedDate(props) {
  return <h2>It is {props.date.toLocaleTimeString()}.</h2>;
}
export default function App(props) {


  const time = (
    <p>{new Date().toLocaleTimeString()}</p>
    );

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit {time} <code>src/App.js</code> and save to reload. <br /> {nama(element)} {dandi} {tampil}
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React 
        </a>
        <br />

        <Welcome name="dandi" />

        <Comment
          text={comment.text}
          author={comment.author}
        />

      <Sum/>

      <Clock date={new Date()} /> 


      </header>
    </div>
  );
}

setInterval(App, 1000);
